object Solution {
    def minimumCost(nums: Array[Int]): Int = {
        val n = nums.length
        val dp = Array.fill(n, 4)(Int.MaxValue)

        // Initialize the first element of each subarray count to the first element of nums,
        // as the minimum cost for the first element is always its value
        for (j <- 1 to 3) dp(0)(j) = nums(0)

        // Loop for each subarray count from 1 to 3
        for (j <- 1 to 3) {
            // Start from the second element as the first element has already been initialized
            for (i <- 1 until n) {
                var minCost = Int.MaxValue
                // Consider all possible previous ends of the subarray
                for (k <- 0 until i) {
                    minCost = minCost min (dp(k)(j - 1) + nums(i))
                }
                dp(i)(j) = minCost
            }
        }

        // The answer is in dp(n-1)(3)
        dp(n - 1)(3)
    }
}
